import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function DataGraph() {
  return (
    <BarChart
      series={[
        { data: [35, 44, 24, 34] }, // 첫 번째 데이터 시리즈
        { data: [51, 6, 49, 30] },  // 두 번째 데이터 시리즈
        { data: [15, 25, 30, 50] }, // 세 번째 데이터 시리즈
        { data: [60, 50, 15, 25] }, // 네 번째 데이터 시리즈
      ]}
      height={290} // 차트의 높이 설정
      xAxis={[{ data: ['Q1', 'Q2', 'Q3', 'Q4'], scaleType: 'band' }]} // x축 레이블
      margin={{ top: 10, bottom: 30, left: 40, right: 10 }} // 여백 설정
    />
  );
}
